INSERT INTO `blogsentry` VALUES ('2dfad5cf-c124-4fce-a9b0-1710c9927898',10863,10202,10154,10198,'Liferay Admin','2013-11-14 09:52:28','2013-11-14 09:52:56','blog on the go','blog-on-the-go','','This is a blog written on the go','2013-11-14 09:51:00',1,1,'',0,10864,'',0,10198,'Liferay Admin','2013-11-14 09:52:56'),('2da73c50-6d14-421a-9b01-da483407cd8e',11213,10181,10154,10198,'Liferay Admin','2013-11-26 10:17:14','2013-11-26 10:17:14','Sample Entry','sample-entry','','Liferay Portal is a free and open source enterprise portal project written in Java and distributed under the GNU Lesser General Public License[2] and optional commercial license.[1] The Liferay project additionally supports Liferay Social Office, Liferay Sync, Liferay AlloyUI, Liferay enterprise Connectivity Apps and the Liferay Marketplace. It is primarily used to power corporate intranets and extranets.[3]\nLiferay Portal is a web platform with features commonly required for the development of websites and portals. Liferay includes a built-in web content management system allowing users to build websites and portals as an assembly of themes, pages, portlets/gadgets and a common navigation.[4] Liferay is sometimes described as a content management framework or a web application framework. Liferay\'s support for plugins extends into multiple programming languages, including support for PHP and Ruby portlets.[5]\nAlthough Liferay offers a sophisticated programming interface for developers, no programming skills are required for basic website installation and administration.\nLiferay Portal is Java-based and runs on any computing platform capable of running the Java Runtime Environment and an application server. Liferay is available bundled with a servlet container such as Apache Tomcat.[6]','2013-11-26 10:16:00',1,1,'',0,11214,'',0,10198,'Liferay Admin','2013-11-26 10:17:14'),('c9a4b43c-c0b5-4ec7-a856-21b10291251a',11222,10181,10154,10198,'Liferay Admin','2013-11-26 10:17:21','2013-11-26 10:17:21','Sample Entry','sample-ent-1','','Liferay Portal is a free and open source enterprise portal project written in Java and distributed under the GNU Lesser General Public License[2] and optional commercial license.[1] The Liferay project additionally supports Liferay Social Office, Liferay Sync, Liferay AlloyUI, Liferay enterprise Connectivity Apps and the Liferay Marketplace. It is primarily used to power corporate intranets and extranets.[3] Liferay Portal is a web platform with features commonly required for the development of websites and portals. Liferay includes a built-in web content management system allowing users to build websites and portals as an assembly of themes, pages, portlets/gadgets and a common navigation.[4] Liferay is sometimes described as a content management framework or a web application framework. Liferay\'s support for plugins extends into multiple programming languages, including support for PHP and Ruby portlets.[5] Although Liferay offers a sophisticated programming interface for developers, no programming skills are required for basic website installation and administration. Liferay Portal is Java-based and runs on any computing platform capable of running the Java Runtime Environment and an application server. Liferay is available bundled with a servlet container such as Apache Tomcat.[6]','2013-11-26 10:16:00',1,1,'',0,11223,'',0,10198,'Liferay Admin','2013-11-26 10:17:21'),('3a2138ac-2e33-45e3-af9f-ad4c11a731f2',11379,11328,10154,10198,'Liferay Admin','2014-03-22 23:06:09','2014-03-22 23:07:32','Theme developer','theme-developer','Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus nec commodo augue, non tempus ante.','<p>&nbsp;Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus nec commodo augue, non tempus ante. Nunc placerat et massa in adipiscing. Morbi rutrum nisl id metus tristique feugiat. Etiam dignissim nunc sit amet ante accumsan, nec rutrum nisl consequat. Nunc tincidunt mattis pulvinar. Sed vitae maur